// Projects.jsx
import React, { useState, useRef, useEffect } from 'react';

function Projects() {
  const projects = [
    {
      id: 1,
      title: "E-Commerce App",
      description: "A beautifully designed Flutter e-commerce application with advanced animations, Firebase backend, and Stripe payment integration.",
      tech: ["Flutter", "Dart", "Firebase", "Stripe API"],
      imageUrl: "https://via.placeholder.com/600x400",
      githubUrl: "#",
      liveUrl: "#"
    },
    {
      id: 2,
      title: "Health & Fitness Tracker",
      description: "A comprehensive health tracking app that integrates with wearable devices, featuring custom animations and real-time statistics visualization.",
      tech: ["Flutter", "Provider", "SQLite", "Chart Libraries"],
      imageUrl: "https://via.placeholder.com/600x400",
      githubUrl: "#",
      liveUrl: "#"
    },
    // {
    //   id: 3,
    //   title: "Social Media Dashboard",
    //   description: "An admin dashboard for social media management with dark/light theme switching, data visualization, and responsive design.",
    //   tech: ["Flutter", "Bloc", "REST API", "Firebase Analytics"],
    //   imageUrl: "https://via.placeholder.com/600x400",
    //   githubUrl: "#",
    //   liveUrl: "#"
    // }
  ];

  const [currentIndex, setCurrentIndex] = useState(0);
  const [showControls, setShowControls] = useState(false);
  const carouselRef = useRef(null);

  // Handle navigation
  const goToNext = () => {
    setCurrentIndex((prevIndex) => (prevIndex + 1) % projects.length);
  };

  const goToPrevious = () => {
    setCurrentIndex((prevIndex) => (prevIndex - 1 + projects.length) % projects.length);
  };

  // Show/hide controls when hovering over the carousel
  const handleMouseEnter = () => {
    if (projects.length > 1) {
      setShowControls(true);
    }
  };

  const handleMouseLeave = () => {
    setShowControls(false);
  };

  // Automatic scrolling effect for infinite feeling
  useEffect(() => {
    if (projects.length <= 1) return;

    const interval = setInterval(() => {
      goToNext();
    }, 5000);

    return () => clearInterval(interval);
  }, []);

  return (
    <div className="container mx-auto px-6">
      <div className="text-center mb-16">
        <h2 className="text-3xl font-bold mb-4">My Projects</h2>
        <div className="w-20 h-1 bg-green-400 mx-auto mb-6"></div>
        <p className="text-gray-300 max-w-2xl mx-auto">
          Here are some of the featured projects I've worked on. Each demonstrates my skills in Flutter development, UI/UX design, and problem-solving.
        </p>
      </div>

      <div className="flex justify-between">
        <button
          onClick={goToPrevious}
          className={`bg-gray-900/50 hover:bg-gray-900/80 text-green-400 p-2 rounded-full transition ${showControls ? 'opacity-70' : 'opacity-0'}`}
          aria-label="Previous project"
        >
          <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 19l-7-7 7-7" />
          </svg>
        </button>

        <div
          className="relative max-w-5xl mx-auto overflow-hidden"
          onMouseEnter={handleMouseEnter}
          onMouseLeave={handleMouseLeave}
          ref={carouselRef}
        >
          {/* Project carousel */}
          <div className="flex transition-transform duration-500 ease-in-out" style={{ transform: `translateX(-${currentIndex * 100}%)` }}>
            {projects.map((project) => (
              <div key={project.id} className="w-full flex-shrink-0 px-4">
                <div className="bg-gray-800 rounded-lg overflow-hidden shadow-lg hover:shadow-green-900/30 transition duration-300 my-4">
                  <div className="h-64 bg-gray-700 flex items-center justify-center">
                    <div className="text-green-400 text-6xl opacity-30">App</div>
                  </div>
                  <div className="p-6">
                    <h3 className="text-xl font-bold mb-3 text-green-400">{project.title}</h3>
                    <p className="text-gray-300 mb-4">{project.description}</p>
                    <div className="flex flex-wrap gap-2 mb-6">
                      {project.tech.map((tech, index) => (
                        <span key={index} className="px-3 py-1 bg-gray-700 text-green-300 text-sm rounded-full">
                          {tech}
                        </span>
                      ))}
                    </div>
                    <div className="flex space-x-4">
                      <a href={project.githubUrl} className="flex items-center text-gray-300 hover:text-green-400 transition">
                        <span>GitHub</span>
                        <svg xmlns="http://www.w3.org/2000/svg" className="h-4 w-4 ml-1" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M10 6H6a2 2 0 00-2 2v10a2 2 0 002 2h10a2 2 0 002-2v-4M14 4h6m0 0v6m0-6L10 14" />
                        </svg>
                      </a>
                      <a href={project.liveUrl} className="flex items-center text-gray-300 hover:text-green-400 transition">
                        <span>Live Demo</span>
                        <svg xmlns="http://www.w3.org/2000/svg" className="h-4 w-4 ml-1" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                          <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M10 6H6a2 2 0 00-2 2v10a2 2 0 002 2h10a2 2 0 002-2v-4M14 4h6m0 0v6m0-6L10 14" />
                        </svg>
                      </a>
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>

          {/* Dots indicator for multiple projects */}
          {projects.length > 1 && (
            <div className="flex justify-center mt-6 space-x-2">
              {projects.map((_, index) => (
                <button
                  key={index}
                  onClick={() => setCurrentIndex(index)}
                  className={`w-2 h-2 rounded-full transition-all ${currentIndex === index ? 'bg-green-400 w-6' : 'bg-gray-600'}`}
                  aria-label={`Go to project ${index + 1}`}
                />
              ))}
            </div>
          )}
        </div>

        <button
          onClick={goToNext}
          className={`bg-gray-900/50 hover:bg-gray-900/80 text-green-400 p-2 rounded-full transition ${showControls ? 'opacity-70' : 'opacity-0'}`}
          aria-label="Next project"
        >
          <svg xmlns="http://www.w3.org/2000/svg" className="h-6 w-6" fill="none" viewBox="0 0 24 24" stroke="currentColor">
            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 5l7 7-7 7" />
          </svg>
        </button>
      </div>
    </div>
  );
}

export default Projects;
